  false,\n\t\"url\": null,\n\t\"notes\": \"Los Angeles gets its water from several
  sources, including local water supplies, recycled water and the Owens Valley. When
  those sources do not provide enough to meet demand, the DWP must purchase water
  on the open market from the Metropolitan Water District. Water from the MWD costs
  more than the other sources, so keeping purchases from MWD low is important to ensuring
  stable and affordable rates for DWP customers. More information: https://www.ladwp.com/ladwp/faces/ladwp/aboutus/a-water/a-w-sourcesofsupply?_adf.ctrl-state=1cnzdaglow_191&_afrLoop=65694383993634&_afrWindowMode=0&_afrWindowId=null#%40%3F_afrWindowId%3Dnull%26_afrLoop%3D65694383993634%26_afrWindowMode%3D0%26_adf.ctrl-state%3D15ucu0sq05_17\",\n\t\"license_title\":
